    <p class=MsoNormal><span style='font-size:12.0pt;line-height:105%;
    font-family:"Britannic Bold",sans-serif'>continente ubicado enteramente en
    el hemisferio norte y mayoritariamente en el hemisferio oriental.<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:12.0pt;line-height:105%;
    font-family:"Britannic Bold",sans-serif'>¿Qué distingue a Europa?<o:p></o:p></span></p>
    <p class=MsoNormal><span style='font-size:12.0pt;line-height:105%;
    font-family:"Britannic Bold",sans-serif'>Europa tiene la mayor diversidad
    cultural y lingüística del mundo occidental. Sin embargo, la evolución histórica,
    geográfica y sociopolítica del continente, además de las divergencias
    culturales de las antiguas colonias, han dado lugar a variaciones
    dependiendo del continente<o:p></o:p></span></p>
    </div>
